import React, { useState, useEffect } from "react";
import axios from "axios";
import { PencilIcon, TrashIcon, PlusCircleIcon } from "@heroicons/react/solid";

function Home2() {
  const [osis, setOsis] = useState([]);
  const [newOsis, setNewOsis] = useState({ name: "", role: "", age: "" });
  const [editingOsis, setEditingOsis] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchOsis();
  }, []);

  const fetchOsis = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/osis");
      setOsis(response.data);
      setError(null);
    } catch (error) {
      console.error("There was an error fetching the OSIS data:", error);
      setError("There was an error fetching the data. Please try again later.");
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewOsis({ ...newOsis, [name]: value });
  };

  const handleCreate = async () => {
    try {
      const response = await axios.post("http://localhost:5000/api/osis", newOsis);
      setOsis([...osis, response.data]);
      setNewOsis({ name: "", role: "", age: "" });
    } catch (error) {
      console.error("There was an error creating the OSIS data:", error);
    }
  };

  const handleUpdate = async () => {
    try {
      const response = await axios.put(`http://localhost:5000/api/osis/${editingOsis._id}`, editingOsis);
      const updatedOsis = osis.map((o) => (o._id === editingOsis._id ? response.data : o));
      setOsis(updatedOsis);
      setEditingOsis(null);
    } catch (error) {
      console.error("There was an error updating the OSIS data:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/osis/${id}`);
      setOsis(osis.filter((o) => o._id !== id));
    } catch (error) {
      console.error("There was an error deleting the OSIS data:", error);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-6">Data Pengurus OSIS</h1>
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative mb-6 max-w-lg mx-auto" role="alert">
          <strong className="font-bold">Error:</strong>
          <span className="block sm:inline"> {error}</span>
        </div>
      )}
      <div className="mb-6 max-w-lg mx-auto">
        <h2 className="text-2xl font-bold mb-2">Add New OSIS</h2>
        <input
          type="text"
          name="name"
          value={newOsis.name}
          onChange={handleInputChange}
          placeholder="Name"
          className="w-full mb-2 p-2 border border-gray-300 rounded"
        />
        <input
          type="text"
          name="role"
          value={newOsis.role}
          onChange={handleInputChange}
          placeholder="Role"
          className="w-full mb-2 p-2 border border-gray-300 rounded"
        />
        <input
          type="number"
          name="age"
          value={newOsis.age}
          onChange={handleInputChange}
          placeholder="Age"
          className="w-full mb-2 p-2 border border-gray-300 rounded"
        />
        <button onClick={handleCreate} className="bg-green-500 text-white px-4 py-2 rounded flex items-center">
          <PlusCircleIcon className="h-5 w-5 mr-2" /> Add
        </button>
      </div>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {osis.map((o) => (
          <div key={o._id} className="bg-white p-6 rounded-lg shadow-md">
            {editingOsis && editingOsis._id === o._id ? (
              <div>
                <input
                  type="text"
                  name="name"
                  value={editingOsis.name}
                  onChange={(e) => setEditingOsis({ ...editingOsis, name: e.target.value })}
                  className="w-full mb-2 p-2 border border-gray-300 rounded"
                />
                <input
                  type="text"
                  name="role"
                  value={editingOsis.role}
                  onChange={(e) => setEditingOsis({ ...editingOsis, role: e.target.value })}
                  className="w-full mb-2 p-2 border border-gray-300 rounded"
                />
                <input
                  type="number"
                  name="age"
                  value={editingOsis.age}
                  onChange={(e) => setEditingOsis({ ...editingOsis, age: e.target.value })}
                  className="w-full mb-2 p-2 border border-gray-300 rounded"
                />
                <button onClick={handleUpdate} className="bg-blue-500 text-white px-4 py-2 rounded flex items-center mb-2">
                  <PencilIcon className="h-5 w-5 mr-2" /> Update
                </button>
                <button onClick={() => setEditingOsis(null)} className="bg-gray-500 text-white px-4 py-2 rounded flex items-center">
                  Cancel
                </button>
              </div>
            ) : (
              <div>
                <h2 className="text-xl font-bold mb-2">{o.name}</h2>
                <p className="text-gray-700 mb-1">Role: {o.role}</p>
                <p className="text-gray-700">Age: {o.age}</p>
                <div className="flex justify-end mt-4">
                  <button onClick={() => setEditingOsis(o)} className="bg-blue-500 text-white px-4 py-2 rounded flex items-center mr-2">
                    <PencilIcon className="h-5 w-5" />
                  </button>
                  <button onClick={() => handleDelete(o._id)} className="bg-red-500 text-white px-4 py-2 rounded flex items-center">
                    <TrashIcon className="h-5 w-5" />
                  </button>
                </div>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home2;
